import React from 'react'
import {BrowerRouter as  Router} from 'react-router-dom'
import Exercises from './pages/Exercise'

function App() {
    return (
        <BrowerRouter>
            <Route path="/exercise" component={Exsercises}/>
            <Route path="/exerciseNew" component={ExsercisesNew}/>
        </BrowerRouter>
    )
}
export default App
